import d3 from 'd3';

function ResultExampleGraph({ data }) {
  // console.log(data)

  const yAccessor = d => d["total"]


  return (
    <div className="border-2 border-sky-400">
      <h3>Result Example Graph</h3>

      <ul>
        {data.map((datum, i) => (
          <li key={i}>{datum.name} {datum.total}</li>
        ))}
      </ul>
    </div>
  );
}

export default ResultExampleGraph;
